function Header() {
  return (
    <div className="flex h-14 bg-blue-300 justify-around">
      <div className="Logo">
        <span>LOGO</span>
      </div>
      <div className="Auth"></div>
      <div className="Shopping">
        <Link>
          {" "}
          <img src="/frontend/public/images/shopping-cart.png" alt="" />
        </Link>
      </div>
    </div>
  );
}

export default Header;
